        "pkg-path": "python311Packages.requests"
      }
    },
    "vars": {
      "AIRBYTE_EMAIL": "localmail@example.com",
      "AIRBYTE_PASSWORD": "localpassword",
      "GCLOUD_SERVICE_MAIL": "airbyte-gcloud-sources@airbyte-sources.iam.gserviceaccount.com"
    },
    "hook": {
      "on-activate": "  export PATH=$(go env GOPATH)/bin:$PATH\n\n  if ! command -v abctl 2>&1 >/dev/null\n  then\n      go install github.com/airbytehq/abctl@latest\n  fi\n\n  abctl local install\n  abctl local credentials --email $AIRBYTE_EMAIL --password $AIRBYTE_PASSWORD\n\n  output=$(abctl local credentials 2>&1 | sed $'s/\u001b\\[[0-9;]*m//g')\n  client_id=$(echo \"$output\" | awk '/Client-Id:/ {print $2}')\n  client_secret=$(echo \"$output\" | awk '/Client-Secret:/ {print $2}')\n  export AIRBYTE_CLIENT_ID=\"$client_id\"\n  export AIRBYTE_CLIENT_SECRET=\"$client_secret\"\n  python airbyte-conf.py\n"
    },
    "profile": {},
    "options": {
      "systems": [
        "aarch64-darwin",
        "aarch64-linux",
        "x86_64-darwin",
        "x86_64-linux"
      ],
      "allow": {
        "licenses": []
      },
      "semver": {}
    }
  },
